import React from 'react'
import DeleteForeverIcon from '@material-ui/icons/DeleteForever';

export default function Note(props){

    return (
        <div className="note">
            <h1>{props.title}</h1>
            <p>{props.content}</p>
            <button><DeleteForeverIcon 
            onClick={()=>{
                props.delete(props.id)}}/>
            </button>
        </div>
    )
}
